SUPER NOUNOU à domicile pour les enfants de plus de 4 ans /sans déplacements/ dans la ville de Palau-Del-Vidre et ses environs. 
- l'organisation de la routine quotidienne (alimentation, prise en charge de l'alimentation saine de l'enfant) ;
- l'exécution de procédures d'hygiène ;
- soins pour le développement mental et physique général ;
- la préoccupation pour la sécurité de l'enfant ;
- communication uniquement en anglais pendant la journée possible à la demande des parents.

Preparation de repas;
